App\Entity\Session:
    session{1..20}:
        customTitle: '<catchPhrase()>'
        sport: '@sport<numberBetween(1, 100)>'
        city: '@city<numberBetween(1, 100)>'
        user: '@user<numberBetween(1, 10)>'
        price: '<numberBetween(10, 200)>'
        start: '<dateTimeBetween("-10 days", "now")>'
        end: '<dateTimeBetween("now", "+200 days")>'
        duration: '<numberBetween(10, 200)>'
    session{21..50}:
        customTitle: '<catchPhrase()>'
        sport: '@sport<numberBetween(1, 100)>'
        city: '@city<numberBetween(1, 100)>'
        user: '@userTest'
        price: '<numberBetween(10, 200)>'
        start: '<dateTimeBetween("-10 days", "now")>'
        end: '<dateTimeBetween("now", "+200 days")>'
        duration: '<numberBetween(10, 200)>'
        comment: 'test'
